import { StatusBar } from 'expo-status-bar';
import React, {useState, useEffect} from 'react';
import { StyleSheet, Text, View, Button, TextInput, Picker } from 'react-native';
import Carousel from 'react-native-snap-carousel';

const data = [
  {
    title: "Aenean leo",
    body: "Ut tincidunt tincidunt erat. Sed cursus turpis vitae tortor. Quisque malesuada placerat nisl. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem.",
    imgUrl: "https://picsum.photos/id/11/200/300",
  },
  {
    title: "In turpis",
    body: "Aenean ut eros et nisl sagittis vestibulum. Donec posuere vulputate arcu. Proin faucibus arcu quis ante. Curabitur at lacus ac velit ornare lobortis. ",
    imgUrl: "https://picsum.photos/id/10/200/300",
  },
  {
    title: "Lorem Ipsum",
    body: "Phasellus ullamcorper ipsum rutrum nunc. Nullam quis ante. Etiam ultricies nisi vel augue. Aenean tellus metus, bibendum sed, posuere ac, mattis non, nunc.",
    imgUrl: "https://picsum.photos/id/12/200/300",
  },
];

function generate_url(poi_name, poi_image_name, action_name, action_shot_type, age, gender, other_details){
  return "http://127.0.0.1:8000/diffusers_api/generate_image?" + 
    "poi_name=" + poi_name + 
    "&poi_image_name=" + poi_image_name +
    "&action_name=" + action_name + 
    "&action_shot_type=" + action_shot_type +
    "&age=" + age + 
    "&gender=" + gender +
    "&other_details=" + other_details;
}

function GenerateImageForm(){
  // Gladdo: Le seguenti strutture definiscono lo stato associato alla funzione; attraverso useState una funzione, un pò come una classe, può avere uno stato associato.
  const [available_pois, setAvailablePois] = useState("");
  const [loaded, setLoaded] = useState(false);

  // Gladdo: Definisco un'arrow function così che il this si riferisca allo stato della funzione in cui è definita l'arrow function
  const generate_image = () => {

  }

  /* Gladdo: useEffect viene chiamata da React-Native solo la prima volta che il componente associato a GenerateImageForm viene renderizzato.
  Il corpo di useEffect fetcha dei dati da un server e utilizza tali dati per modificare lo stato della funzione; il cambiamento di stato triggera il re-rendering del componente.
  Nel re-rendering viene poi utilizzato i dati fetchati per popolare i campi del form. */
  useEffect(() => {
    fetch("http://127.0.0.1:8000/diffusers_api/test_serializer")
    .then( (response) =>  response.json())
    .then( 
      json => {
        setAvailablePois(json['pois']);
        console.log(json['pois']);
        setLoaded(true);
      }
    )
  }, []);

  /* Gladdo: Itera sui pois fetchati e ci costruisce un componente */
  var poi_names = [];

  for(var i = 0; i < available_pois.length; i++){
    poi_names.push(
      <Text key={i}>
        {available_pois[i].name}
      </Text>
    );
  }

  if(loaded){
    return (
      <View style={styles.form_container}>
        <Text style={styles.form_element}>Poi names:  </Text>
        {poi_names}
        <Text style={styles.form_element}>Other Details </Text>
        <TextInput
          style={[styles.text_input, styles.form_element]}
          placeholder=" write here... "
          onChangeText={newText => setPoiName(newText)}
        />
        <View style={styles.generate_button}>
          <Button  title="GENERATE IMAGE" onPress={generate_image} > GENERATE </Button>
        </View>

      </View>
    )
  }else{
    return (
      <View>
        <Text> Loading Form ... </Text>
      </View>
    )
  }


}

const CarouselCardItem = ({ item, index }) => {
  return (
    <View style={styles.container_carousel} key={index}>
      <Image
        source={{ uri: item.imgUrl }}
        style={styles.image}
      />
      <Text style={styles.header}>{item.title}</Text>
      <Text style={styles.body}>{item.body}</Text>
    </View>
  )
}

export default function App() {
  return (
    <View style={styles.container}>
      <GenerateImageForm /> 
      <StatusBar style="auto" />

      <Carousel
        layout="tinder"
        layoutCardOffset={9}
        ref={isCarousel}
        data={data}
        renderItem={CarouselCardItem}
        sliderWidth={300}
        itemWidth={280}
        inactiveSlideShift={0}
        useScrollView={true}
      />

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  form_container: {
    width: '80%',
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  form_element: {
    width: '100%',
    margin: 4,
  }, 

  text_input: {
    height: 40,
    borderWidth: 1,
    borderRadius: 4,
  },

  generate_button: {
    width: '80%',
    backgroundColor: 'red',
  }, 

  container_carousel: {
    backgroundColor: 'white',
    borderRadius: 8,
    width: ITEM_WIDTH,
    paddingBottom: 40,
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 3,
    },
    shadowOpacity: 0.29,
    shadowRadius: 4.65,
    elevation: 7,
  },
  image: {
    width: ITEM_WIDTH,
    height: 300,
  },
  header: {
    color: "#222",
    fontSize: 28,
    fontWeight: "bold",
    paddingLeft: 20,
    paddingTop: 20
  },
  body: {
    color: "#222",
    fontSize: 18,
    paddingLeft: 20,
    paddingLeft: 20,
    paddingRight: 20
  }

});



